import React from "react";
import { StyleSheet, Text, View, Button } from "react-native";

const GetButton = () => {
  <View style={styles.button}>
    <Button
      onPress={onClick}
      title="Travel Buddy"
      color="#244D9D"
      style={styles.button}
    />
  </View>;
};

const styles = StyleSheet.create({
  button: {
    marginBottom: 50,
    marginHorizontal: 15,
  },
});

export default GetButton;
